import React from "react";

const Booklist = () => {
  return (
    <div
      className="main"
      style={{
        display: "flex",
        flexDirection: "column"
      }}
    >
      <div
        className="main-headers"
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          marginTop: "50px",
          padding: "1.5% 10% 1.5% 10%",
          backgroundColor: "teal",
          fontSize: "20px"
        }}
      >
        <p>Title</p>
        <p>Author</p>
        <p>ISBN</p>
        <p>READ?</p>
      </div>

      <div
        className="main-books"
        style={{
          display: "flex",
          justifyContent: "space-between"
        }}
      >
        <p>HELLO</p>
        <p>HELLO</p>
      </div>
    </div>
  );
};

export default Booklist;
